//SPDX-License-Identifier:MIT
pragma solidity ^0.8.2;

contract intVariation{
int8 public int8Min= type(int8).min;
int8 public int8Max = type(int8).max;
uint8 public uint8Min= type(uint8).min;
uint8 public uint8Max = type(uint8).max;
int16 public int16min = type(int16).min;
int16 public int16max = type(int16).max;
int32 public int32min = type(int32).min;
int32 public int32max = type(int32).max;
int64 public int64min = type(int64).min;
int64 public int64max = type(int64).max;
int128 public int128min = type(int128).min;
int128 public int128max = type(int128).max;
int256 public int256min = type(int256).min;
int256 public int256max = type(int256).max;
}

